/*Table structure for table `rou_bill` */

DROP TABLE IF EXISTS `rou_bill`;

CREATE TABLE `rou_bill` (
  `bill_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '单据表id',
