/*Table structure for table `rou_department` */

DROP TABLE IF EXISTS `rou_department`;

CREATE TABLE `rou_department` (
  `department_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '部门id',
  `department_name` varchar(64) NOT NULL DEFAULT '' COMMENT '部门名',
