  `creator_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建人id',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`department_id`),
  UNIQUE KEY `uk_department_code` (`department_code`) USING BTREE,
  UNIQUE KEY `uk_department_name` (`department_name`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8 COMMENT='部门表';

