/*Table structure for table `rou_handle_record` */

DROP TABLE IF EXISTS `rou_handle_record`;

CREATE TABLE `rou_handle_record` (
  `record_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '记录id',
  `handle_type_id` tinyint(4) NOT NULL DEFAULT '0' COMMENT '执行操作类型',
  `handle_type_name` varchar(20) NOT NULL DEFAULT '' COMMENT '执行操作类型名',
  `handled_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '被处理的id',
  `del` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否删除',
  `modifier_id` int(11) unsigned DEFAULT '0' COMMENT '修改人id',
  `modify_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `creator_id` int(11) unsigned DEFAULT '0' COMMENT '创建人就是操作人（被记录的管理员id）',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`record_id`)
) ENGINE=InnoDB AUTO_INCREMENT=647 DEFAULT CHARSET=utf8 COMMENT='管理员操作记录表（更新操作）';

