  `notice_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `notice_name` varchar(64) NOT NULL DEFAULT '' COMMENT '消息通知名称',
  `handle_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建消息的对象id',
  `notice_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '消息通知类型',
  `notice_content` varchar(128) NOT NULL DEFAULT '' COMMENT '消息通知内容',
  `del` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否删除',
  `modifier_id` int(11) unsigned DEFAULT '0' COMMENT '修改人id',
