/*Table structure for table `rou_ware` */

DROP TABLE IF EXISTS `rou_ware`;

CREATE TABLE `rou_ware` (
  `ware_id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '物品表id',
  `ware_name` varchar(64) NOT NULL DEFAULT '' COMMENT '物品名称',
  `ware_code` varchar(32) NOT NULL DEFAULT '' COMMENT '物品编码',
  `ware_item_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '所属物品项目类别id',
  `ware_describe` varchar(128) NOT NULL DEFAULT '' COMMENT '物品描述',
  `ware_cost_price` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '成本价(分)',
  `ware_sell_price` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '销售价（分）',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '库存数量',
  `unit` varchar(8) NOT NULL DEFAULT '' COMMENT '单位',
  `distance_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '距离数量（提醒）',
  `distance_time` date NOT NULL DEFAULT '0000-00-00' COMMENT '距离日期（提醒）',
  `expiration_time` date NOT NULL DEFAULT '0000-00-00' COMMENT '到期日期',
  `del` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否删除',
  `modifier_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '修改人id',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改日期',
  `creator_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建者id',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`ware_id`),
  UNIQUE KEY `uk_ware_code` (`ware_code`) USING BTREE,
  UNIQUE KEY `uk_ware_name` (`ware_name`),
  KEY `ix_ware_item_id` (`ware_item_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='物品明细表';

